		"text": "팀에 동기부여할 수 있는 칭찬에 대한 글인데 첫번째 나오는 \"이거 정말 멋진데! 도대체 어떻게 한 건지 말해줄 수 있어?\"를 읽자마자 바로 대공감. 일 뒤에 가려져있는 부분까지 경의를 나타냄으로써 결과만이 아니라 그것을 만들어낸 사람에게까지 존경을 표현한 것이 된다. https://t.co/pwAXQJ1kS7"
