		"text": "멜론 측에 예전에 댓글 관련 건의를 했었는데 지금 보니까 전부 반영되어 있다.\n\n그 중 하나는 추천 댓글이 되면 수정을 할 수 없는 것.\n아이돌 앨범, 신보가 뜨면 팬인척 하고 어그로가 이를 선점하기 위한 댓글을 작성하고 추후 댓글을 바꾸는 것이다.\n\n#멜론 #Melon #뮤직비지니스"
