		"text": "공연을 예매하신 관객분들께는 예매 사이트에서 결제하신 금액을 전액 환불 받으실 수 있도록 진행할 예정입니다.\n\r공연을 기대하신 관객분들에게 진심으로 사과의 말씀 드리며, 모두 건강하고 행복하시길 두 손 모아 기원합니다.\n앞으로 더 좋은 공연으로 보답하겠습니다.\n감사합니다."
