		"text": "다양한 사이즈의 귀에 편한 귀마개가 필요한 분들에게 Mack’s를 추천. 맥스는 50년 이상 귀마개를 만든 귀마개 전문 브랜드로 전문화된 제품군, 다양한 크기, 편안한 소재, 저렴한 가격과 귀여운 케이스가 장점. 많은 제품 중 하나만 추천하라면, Ultra Soft. 적당한 크기에 부드러운 착용감. https://t.co/QvLcbbrIzZ"
