		"text": "@seoulrain 저도 알려주신 내용보고 유료 플랜 결제는 해뒀는데 랜딩페이지용이나 링크 정리용으로 사용하고 있어요. 영화 감상목록 정리하고요.\n\nAPI 지원되어서 Automate 붙으면 덕질에도 활용해보려고요."
