		"full_text": "국내에서 인지도나 인식에 대해 변화가 있어야 한다고 봤을 건데 팬덤에서의 반응과 국내 대중에게 인식의 갭이 크기도 하고 이달의 소녀는 18년도 데뷔 콘서트를 통해 데뷔했지만 솔로로 매달 나왔으니 시작은 16년도 10월임. 확고한 컨셉과 그룹컬러 부여 그리고 무엇보다 이야기를 풀어야 할 시기.",
