		"text": "&lt;씬의 아이들&gt;이라는 책의 제목은 참여자보다 나이 많은 기획자가 그들을 단어 그대로 아이들일 때 본 것에서 비롯됐습니다. 누구도 스스로를 아이들이라 부를 생각없고 우리를 보는 사람들도 그럴 겁니다. 그런 의미에서 무의미한 글이 되어 안타깝습니다. 마지막 문장은 귀담아 듣겠습니다. https://t.co/wbUP70pPJ3"
