		"text": "우리는 트위터에서 공유되는 수많은 정보 중 잘못된 정보에 대응하기 위해 노력해왔습니다. 오늘 트위터는 합성 또는 조작된 미디어에 대한 운영원칙을 공개합니다. 3월 5일부터 악의적으로 합성, 조작된 콘텐츠는 라벨이 표시되고 삭제될 수도 있음을 안내드립니다. \nhttps://t.co/053KMeekEX"
