		"text": "성폭력 가해자로 지목된 이는 아주 오래전 여기에 말하기도 구질구질한 이유로 내 계정을 블락했었는데 존재조차 알지 못한 새 공중캠프 계정이 왜 나를 블락하고 있는지 궁금하다. 그리고 최근 공중캠프에서 공연한 음악가가 공중캠프가 왜 사라지게 됐는지 알고 있는지도. https://t.co/wPg4tTsivg https://t.co/nrFAXSRgd6"
